    public int lengthOfLongestSubstring(String s) {
        int[] count = new int[127];
        int k = 0;
        int max = 0;
        for (int i = 0; i < s.length(); i++) {
            char charAt = s.charAt(i);
            if (count[charAt]++ == 0) {
                max = Math.max(i - k + 1, max);
            } else {
                while (true) {
                    char previous = s.charAt(k++);
                    count[previous]--;
                    if (previous == charAt) {
                        break;
                    }
                }
            }
        }
        return max;
    }

